import React from "react";
import {Form, Formik} from "formik";
import {useSigninUserMutation} from "../../store/api/authAPi";
import {Grid, Heading, Stack} from "@chakra-ui/react";
import {InputControl, SubmitButton} from "formik-chakra-ui";
import "./signup.style.sass"
const Signup = () => {
    // const dispatch = useAppDispatch();
    // const [email, setEmail] = useState<string>();
    // const toast = useToast();
    // const navigate = useNavigate();
    // const [signinUser, { data, isLoading, error, isError, isSuccess }] =
    //     useSigninUserMutation();
    // console.log(data);
    // if (isError) {
    //     toast({
    //         title: (error as any).data.message,
    //         status: "error",
    //         duration: 5000,
    //     });
    //     if ((error as any).data.message === "User not Verified") {
    //         navigate("/send-verify-mail", {
    //             state: { email },
    //         });
    //     }
    // }
    // if (isSuccess) {
    //     dispatch(setUser({ token: data.token, name: data.name }));
    //     navigate("/");
    //     localStorage.setItem("token", data.token);
    // }
    //
    // console.log(error);

    const [signupUser, {data, isLoading }] = useSigninUserMutation();
    console.log(data);

    return (
        <Formik
            initialValues={{firstname:"", lastname:"", email: "", password: "" }}

            onSubmit={(values) => {
                signupUser({ ...values });
                // console.log(values);
                // setEmail(values.email);
            }}
        >
            <Form >
                <Grid h="100vh" placeItems="center">
                    <Stack className={"signUpForm"} p="4" boxShadow="xl" borderRadius="md">
                        <Heading
                            color="teal"
                            textAlign="center"
                            fontSize="lg"
                            fontWeight="semibold"
                        >
                            Signin
                        </Heading>
                        <InputControl
                            name="fistname"
                            label="Firstname"
                            inputProps={{
                                type: "text",
                                placeholder: "Enter Firstname...",
                            }}
                        />
                        <InputControl
                            name="lastname"
                            label="Lastname"
                            inputProps={{
                                type: "test",
                                placeholder: "Enter Lastname...",
                            }}
                        />
                        <InputControl
                            name="email"
                            label="Email"
                            inputProps={{
                                type: "email",
                                placeholder: "Enter Email...",
                            }}
                        />
                        <InputControl
                            name="password"
                            label="Password"
                            inputProps={{
                                placeholder: "Enter Password...",
                                type: "password",
                            }}
                        />
                        {/*<Flex justify="flex-end">*/}
                        {/*    <Text as={Link} to="/forgot-password" color="teal">*/}
                        {/*        Forgot Password*/}
                        {/*    </Text>*/}
                        {/*</Flex>*/}
                        <SubmitButton isLoading={isLoading}>Signup</SubmitButton>
                    </Stack>
                </Grid>
            </Form>
        </Formik>
    );
};

export default Signup;
